import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button'


class Time extends React.Component{
    render(){
        return(
            <div>
                 <Button>
                    Time
                 </Button>
            </div>
        );
    }
}
export default Time;
